openapi: 3.0.3
info:
  title: Laravel
  description: ''
  version: 1.0.0
servers:
  -
    url: 'http://localhost:8000'
paths:
  /api/v1/auth/register:
    post:
      summary: 'Create new User'
      operationId: createNewUser
      description: ''
      parameters: []
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                name:
                  type: string
                  description: 'Must be at least 3 characters.'
                  example: thnwpivbtousyjwzvuphouvgsjfpytjlrjkutknorcgho
                email:
                  type: string
                  description: 'Must be a valid email address.'
                  example: okeefe.lolita@example.net
                phone:
                  type: string
                  description: ''
                  example: magni
                password:
                  type: string
                  description: 'Must be at least 8 characters.'
                  example: 'SIe+=xPf:-y:'
              required:
                - name
                - email
                - phone
                - password
      security: []
  /api/v1/auth/login:
    post:
      summary: 'Get a JWT via given credentials.'
      operationId: getAJWTViaGivenCredentials
      description: ''
      parameters: []
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                email:
                  type: string
                  description: 'Must be a valid email address.'
                  example: feest.harry@example.net
                password:
                  type: string
                  description: ''
                  example: 'g%7zA/PUrrRf]S'
              required:
                - email
                - password
      security: []
  /api/v1/auth/verify-user-email:
    post:
      summary: 'Verify user email'
      operationId: verifyUserEmail
      description: ''
      parameters: []
      responses: {  }
      tags:
        - Endpoints
      requestBody:
        required: true
        content:
          application/json:
            schema:
              type: object
              properties:
                email:
                  type: string
                  description: 'Must be a valid email address. Must not be greater than 255 characters.'
                  example: donnell.deckow@example.net
                token:
                  type: string
                  description: 'Must not be greater than 255 characters.'
                  example: wxdfzqdkjypiczzfuve
              required:
                - email
                - token
      security: []
